    #вставка в таблицу данных
    def insertTable(self, nouts):
        
        #очищение таблицы
        for i in range(0, 15):
            for j in range(1, 25):
                item = QTableWidgetItem(str(""))
                self.table.setItem(j, i, item)
        
        #вставка в таблицу
        self.k = 1
        for i in nouts:
            self.kk = 0
            for j in i:
                item = QTableWidgetItem(str(j))
                self.table.setItem(self.k, self.kk, item)
                self.kk = self.kk + 1
            self.k = self.k + 1
     
    #названия столбцов вписываю
    def headerTable(self, head):
        self.k = 0
        for i in head:
            item = QTableWidgetItem(i)
            self.table.setItem(0, self.k, item)
            self.k = self.k + 1
